根据错误信息 `NoResourceFoundException: No static resource reservation/list`，问题出在 Spring Boot 试图将 `/reservation/list` 请求当作静态资源请求处理，而不是路由到你的控制器方法。

这通常有以下几种可能原因：

1. 你的控制器类没有被 Spring 正确扫描到
2. 请求路径配置有问题
3. Spring MVC 配置有问题

以下是修复建议：

1. 首先确保你的控制器类在 Spring Boot 的主应用类所在的包或其子包中，或者明确添加了组件扫描注解：

```java
@SpringBootApplication
@ComponentScan("com.smileshark.controller") // 确保包含你的控制器包
public class YourApplication {
    public static void main(String[] args) {
        SpringApplication.run(YourApplication.class, args);
    }
}
```

2. 检查你的请求路径配置，确保没有冲突。你的当前配置看起来是正确的。

3. 如果你有自定义的 WebMvc 配置，确保没有干扰静态资源处理的配置。

4. 尝试在控制器方法上添加 `@ResponseBody` 注解（虽然 `@RestController` 已经包含了这个功能）：

```java
@GetMapping("/list")
@ResponseBody
public Result<Page<Reservation>> detailList(...) {
    ...
}
```

5. 检查你的 `ReservationService` 是否被正确注入，确保它有 `@Service` 注解。

6. 确保你的项目依赖完整，特别是 Spring Web 相关依赖。

如果以上方法都不能解决问题，请提供：
1. 你的项目结构（特别是包结构）
2. 主应用类的完整代码
3. 任何自定义的 WebMvc 配置
4. 完整的 pom.xml 或 build.gradle 文件

这样我可以更准确地诊断问题所在。

